import { SiFramer } from "react-icons/si";

export default function AnswerSection() {
  return (
      <div className="answerContainer">
          <div style={{display:"flex"}}>
          <SiFramer style={{ color: "#0C5184", fontSize: "1.3em", marginRight:"15px", background: "#ffc0c0",borderRadius: "50%"}}/>
          <p>Who is the founder of OpenAi?</p>
          </div>

          <div style={{display:"flex"}}>
          <SiFramer style={{ color: "#0C5184", fontSize: "1.3em", marginRight:"15px"}}/>
          <p>
            OpenAI was founded in December 2015 by Elon Musk, Sam Altman, Greg
            Brockman, Ilya Sutskever, Wojciech Zaremba, and John Schulman.
          </p>
          </div>


          <div className="chatIcons">
            
          </div>
      </div>
  );
}
